/**
 *
 * Navigation.js
 * @author Peter Laxalt
 * @description The website Navigation.
 *
 */

// Core
import React from "react";
import Link from "next/link";

// Styles
import { ListingsStyle } from "./styles.scss";

// Constants
import { Theme } from "../../constants/Theme";

// Begin Interface
//////////////////////////////////////////////////////////////////////

interface Listing {
  name: string;
  href: string;
  theme: string;
  width: string;
}

// Begin Component
//////////////////////////////////////////////////////////////////////

const projectsPrefix = "/projects";

const projects = [
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Primary,
    width: "20%"
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Warning,
    width: "flex"
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Ocean,
    width: "50%"
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Dino,
    width: "50%"
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Cream,
    width: "flex"
  },
  {
    name: "Test",
    href: projectsPrefix + "/test",
    theme: Theme.Color.Cream,
    width: "30%"
  }
];

const Listing = ({ name, href, theme }: Listing) => (
  <Link href={href}>
    <div className="listing">
      <span>{name}</span>
      <span>{theme}</span>
    </div>
  </Link>
);

export const Listings = () => (
  <ListingsStyle>
    <div className="inner">
      {projects.map(project => {
        return (
          <Listing
            name={project.name}
            href={project.href}
            theme={project.theme}
            width={project.width}
          />
        );
      })}
    </div>
  </ListingsStyle>
);

// End Component
//////////////////////////////////////////////////////////////////////
